export default function createReportObject(employeesList) {
  const allEmployees = {};

  // Group employees by department using spread syntax
  for (const employee of employeesList) {
    const { department } = employee; // Destructure department property
    if (!allEmployees[department]) {
      allEmployees[department] = [];
    }
    allEmployees[department].push(employee.name);
  }

  // Method to get number of departments using ES6 method syntax
  const getNumberOfDepartments = () => Object.keys(allEmployees).length;

  return {
    allEmployees,
    getNumberOfDepartments,
  };
}
